//AUDIO_OUTPUT 3B & 
module max_volumn_beep(input CLOCK, output reg [11:0] volumn);
    always @ (CLOCK) begin volumn = (CLOCK == 1) ? 12'hFFF : 0; end
endmodule

module half_volumn_beep(input CLOCK, output reg [11:0] volumn);
    always @ (CLOCK) begin volumn = (CLOCK == 1) ? 12'h800 : 0; end
endmodule

module button_detection(input clk100M, input pushbutton, output reg signal = 0);
    reg[15:0] limit = 10000;
    reg[15:0] count = 0;
    always @ (posedge clk100M) begin
        if (pushbutton !== signal) begin 
            if (count < limit) count <= count + 1; 
            else begin count <= 0; signal <= pushbutton; end
        end
        else count = 0;
    end
endmodule 

module timer(input initialization, input clk100M, input [31:0] limit, output reg signal = 0);
    reg [31:0] count = 0;
    reg button = 0;
    always @ (posedge clk100M) begin 
        if (button == 0) begin
            if (initialization == 1) begin signal <= 1; count <=0; end
        end
        if (signal == 1) begin
            if (count == limit) begin count <= 0; signal <= 0; end
            else count = count + 1;
        end
        button <= initialization;
    end
endmodule

module audio_out_task4b(input clk100M, clk190, clk380, input btnC, input [3:0] switch, output[11:0] audio_out);
    wire initialization;
    wire sound;
    wire [11:0] signal_190; wire [11:0] signal_380; wire [11:0] signal_out;
    button_detection button(clk100M, btnC, initialization);
    timer time_1sec(initialization, clk100M, 100000000, sound); 
    max_volumn_beep signal_190Hz(clk190, signal_190);
    half_volumn_beep signal_380Hz(clk380, signal_380);
    assign signal_out = (switch == 1) ? signal_190 : signal_380;
    assign audio_out = (sound == 1) ? signal_out : 0;   
endmodule

module audio_group_task(input clk100M, clk190, isValid, input [3:0] valid_num, output[11:0] audio_out);    //beep in 4E-5
    wire [31:0] duration = valid_num * 10000000;
    wire sound; wire [11:0] signal_190;
    max_volumn_beep(clk190, signal_190);
    timer(isValid, clk100M, duration, sound);
    assign audio_out = (sound == 1) ? signal_190 : 0;
endmodule

module audio_improvement(input clk100M, input [11:0] button_clk, output reg [11:0] output_signal = 0);
    reg [3:0] num_of_keys = 0;
    always @ (button_clk) begin
        num_of_keys = 0;
        if (button_clk[11] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[10] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[9] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[8] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[7] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[6] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[5] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[4] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[3] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[2] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[1] == 1) num_of_keys = num_of_keys + 1;
        if (button_clk[0] == 1) num_of_keys = num_of_keys + 1;
    end
    
    wire [11:0] keyboard_signal;
    music_notes display_tones(clk100M, button_clk, keyboard_signal);
    
    always @ (button_clk) begin
        case (num_of_keys)
            0 : output_signal <= 0;
            1 : output_signal <= 60 * keyboard_signal;
            2 : output_signal <= 30 * keyboard_signal;
            3 : output_signal <= 20 * keyboard_signal;
            4 : output_signal <= 15 * keyboard_signal;
            5 : output_signal <= 12 * keyboard_signal;
            6 : output_signal <= 10 * keyboard_signal;
            7 : output_signal <= 8 * keyboard_signal;
            8 : output_signal <= 7 * keyboard_signal;
            9 : output_signal <= 6 * keyboard_signal;
            10 : output_signal <= 6 * keyboard_signal;
            11 : output_signal <= 5 * keyboard_signal;
            12 : output_signal <= 5 * keyboard_signal;
            default : output_signal <= 0;
        endcase
    end
    
endmodule

module music_notes(input clk100M, input [11:0] switch_key, output reg [11:0] signal = 0);   
    //Note C //freq = 261.63;
    wire clk_C;
    clock_divider clock_C(clk100M, 1400, clk_C);
    wire [11:0] signal_C;
    signal_generation C(clk_C, signal_C);
    
    //Note CS //freq = 277.18;
    wire clk_CS;
    clock_divider clock_CS(clk100M, 1322, clk_CS);
    wire [11:0] signal_CS;
    signal_generation CS(clk_CS, signal_CS);
    
    //Note D //freq = 293.66;
    wire clk_D;
    clock_divider clock_D(clk100M, 1247, clk_D);
    wire [11:0] signal_D;
    signal_generation D(clk_D, signal_D);
    
    //Note DS //freq = 311.13;
    wire clk_DS;
    clock_divider clock_DS(clk100M, 1177, clk_DS);
    wire [11:0] signal_DS;
    signal_generation DS(clk_DS, signal_DS);

    //Note E //freq = 329.63;
    wire clk_E;
    clock_divider clock_E(clk100M, 1111, clk_E);
    wire [11:0] signal_E;
    signal_generation E(clk_E, signal_E);

    //Note F //freq = 349.23;
    wire clk_F;
    clock_divider clock_F(clk100M, 1049, clk_F);
    wire [11:0] signal_F;
    signal_generation F(clk_F, signal_F);

    //Note FS  //freq = 369.99;
    wire clk_FS;
    clock_divider clock_FS(clk100M, 990, clk_FS);
    wire [11:0] signal_FS;
    signal_generation FS(clk_FS, signal_FS);

    //Note G  //freq = 392.00;
    wire clk_G;
    clock_divider clock_G(clk100M, 934, clk_G);
    wire [11:0] signal_G;
    signal_generation G(clk_G, signal_G);

    //Note GS  //freq = 415.30;
    wire clk_GS;
    clock_divider clock_GS(clk100M, 882, clk_GS);
    wire [11:0] signal_GS;
    signal_generation GS(clk_GS, signal_GS);

    //Note A  //freq = 440.00;
    wire clk_A;
    clock_divider clock_A(clk100M, 833, clk_A);
    wire [11:0] signal_A;
    signal_generation A(clk_A, signal_A);

    //Note AS //freq = 466.16;
    wire clk_AS;
    clock_divider clock_AS(clk100M, 786, clk_AS);
    wire [11:0] signal_AS;
    signal_generation AS(clk_AS, signal_AS);

    //Note B   //freq = 493.88;
    wire clk_B;
    clock_divider clock_B(clk100M, 742, clk_B);
    wire [11:0] signal_B;
    signal_generation B(clk_B, signal_B);
    
    always @ (switch_key) begin
        signal = 0;
        if (switch_key[11] == 1) signal = signal + signal_C;
        if (switch_key[10] == 1) signal = signal + signal_CS;
        if (switch_key[9] == 1) signal = signal + signal_D;
        if (switch_key[8] == 1) signal = signal + signal_DS;
        if (switch_key[7] == 1) signal = signal + signal_E;
        if (switch_key[6] == 1) signal = signal + signal_F;
        if (switch_key[5] == 1) signal = signal + signal_FS;
        if (switch_key[4] == 1) signal = signal + signal_G;
        if (switch_key[3] == 1) signal = signal + signal_GS;
        if (switch_key[2] == 1) signal = signal + signal_A;
        if (switch_key[1] == 1) signal = signal + signal_AS;
        if (switch_key[0] == 1) signal = signal + signal_B;
    end
endmodule

module signal_generation(input clk, output reg [11:0] signal = 0);   
    reg count = 1; 
    always @ (posedge clk) begin
        if (signal == 0) count = 1;
        if (signal == 68) count = 0;
        signal = (count == 1) ? signal + 1 : signal - 1;
    end  
endmodule

module audio_all_tasks(input clk100M, clk190, clk380, btnC, input [15:0] sw, input isValid, 
    input [3:0] valid_num, output [11:0] audio_out);
    wire [11:0] individual_audio_out;
    wire [11:0] group_audio_out;
    wire [11:0] audio_improvement;
    wire [11:0] keyboard = sw[13:2];
    assign audio_out = (sw[1] == 1) ? audio_improvement : (isValid == 1) ? group_audio_out : individual_audio_out;
    audio_out_task4b individual_task_out(clk100M, clk190, clk380, btnC, sw[0], individual_audio_out); 
    audio_group_task group_task_out(clk100M, clk190, isValid, valid_num, group_audio_out);
    audio_improvement improvement_task_out(clk100M, keyboard, audio_improvement);
endmodule

//OLED & MOUSE (task 4E1 - 4E4),
module slow_clock (input clock, input [28:0] iters, output slower);
    reg [28:0] count = 0;
    reg slow_clock = 0;
    assign slower = slow_clock;
    always @ (posedge clock) begin
        count <= (count == iters) ? 0 : count + 1;
        slow_clock <= (count == 0) ? ~slow_clock : slow_clock;
    end
endmodule

module get_pixel_position (input [12:0] pixel_index, output [12:0] x, output [12:0] y);
    assign x = 95 - pixel_index % 96;
    assign y = 63 - pixel_index / 96;
endmodule

module color_from_audio (input [3:0] CA_4, output [15:0] RGB);
    parameter RED = 16'b1111100000000000;
    parameter ORANGE = 16'b1111011000000000;
    parameter YELLOW = 16'b1111111111100000;
    parameter GREEN = 16'b0000011111100000;
    parameter BLUE = 16'b0000000000011111;
    parameter INDIGO = 16'b0000011111111111;
    parameter VIOLET = 16'b1111100000011111;
    
    assign RGB = (CA_4 < 1) ? RED :
                 (CA_4 < 2) ? ORANGE :
                 (CA_4 < 3) ? YELLOW :
                 (CA_4 < 4) ? GREEN :
                 (CA_4 < 5) ? BLUE :
                 (CA_4 < 6) ? INDIGO : VIOLET;
endmodule

