module display_number (input [6:0] segments, input [12:0] x, input [12:0] y, input [11:0] mouse_x, input [11:0] mouse_y, output [15:0] oled_data, input left, right, middle, clock);
    parameter RED = 16'b11111_000000_00000;
    parameter GREEN = 16'b00000_111111_00000;
    parameter WHITE = 16'b11111_111111_11111;
    parameter BLACK = 0;
    
    reg size = 0;
    reg [15:0] display;
    assign oled_data = display;
    reg [6000:0] active = 0;        
//            (x - 1) + (y - 1)* 95: 0-th  (y: 1-63, x:1-95)
//            (x-1) + (y-1) * 95 + 15: 15-th
    always @ (posedge clock) begin
        active[mouse_x + 64 * mouse_y] <= left ? 1 : right ? 0 : active [mouse_x + 64 * mouse_y];
        display <= (middle == 0 && x >= mouse_x - 1 && x <= mouse_x + 1 && y >= mouse_y - 1 && y <= mouse_y + 1) ? WHITE :
                (middle == 1 && x == mouse_x && y == mouse_y) ? WHITE : (active[x + 64 * y]) ? RED : BLACK;
    end
endmodule

module get_number_from_segments (input [6:0] segments, output [3:0] number);
    assign number =
        segments == 7'b0_111_111 ? 0 :
        segments == 7'b0_000_110 ? 1 :
        segments == 7'b1_011_011 ? 2 :
        segments == 7'b1_001_111 ? 3 :
        segments == 7'b1_100_110 ? 4 :
        segments == 7'b1_101_101 ? 5 :
        segments == 7'b1_111_101 ? 6 :
        segments == 7'b0_000_111 ? 7 :
        segments == 7'b1_111_111 ? 8 :
        segments == 7'b1_101_111 ? 9 : 10;
endmodule

module get_segments_from_number (input [3:0] number, output [6:0] segments);
    assign segments =
        number == 0 ? 7'b0_111_111 :
        number == 1 ? 7'b0_000_110 :
        number == 2 ? 7'b1_011_011 :
        number == 3 ? 7'b1_001_111 :
        number == 4 ? 7'b1_100_110 :
        number == 5 ? 7'b1_101_101 :
        number == 6 ? 7'b1_111_101 :
        number == 7 ? 7'b0_000_111 :
        number == 8 ? 7'b1_111_111 :
        number == 9 ? 7'b1_101_111 : 7'b0_000_000;
endmodule

module reverse (input [6:0] a, output [6:0] b);
    assign b = {~a[6], ~a[5], ~a[4], ~a[3], ~a[2], ~a[1], ~a[0]};
endmodule

module display_in_seven_segments (input clock, input [3:0] number, input [3:0] audio_intensity, input is_active, output [6:0] seg, output [3:0] an, output dp);
    parameter display_first = 2'b00;
    parameter display_second = 2'b01;
    parameter display_fourth = 2'b10;
    
    reg [2:0] display_digit = display_fourth;
    wire [3:0] first_digit = number == 9 ? 1 : 0;
    wire [3:0] second_digit = number == 9 ? 0 : number + 1;
    wire [6:0] first_segments, second_segments, fourth_segments, first_seg, second_seg, fourth_seg;
    
    get_segments_from_number gsn1 (first_digit, first_segments);
    get_segments_from_number gsn2 (second_digit, second_segments);
    get_segments_from_number gsn3 (audio_intensity, fourth_segments);
    reverse r1 (first_segments, first_seg);
    reverse r2 (second_segments, second_seg);
    reverse r3 (fourth_segments, fourth_seg);
    
    assign an = ~is_active ? 4'b1110 : (display_digit == display_first) ? 4'b0111 : 
                                       (display_digit == display_second) ? 4'b1011 : 4'b1110;
    assign dp = number > 9 ? 1 : ~(display_digit == display_first);
    assign seg = (display_digit == display_first) ? first_seg :
                 (display_digit == display_second) ? second_seg : fourth_seg;
    
    always @ (posedge clock) begin
        display_digit <= ~is_active ? display_fourth :
        (display_digit == display_first) ? display_second :
        (display_digit == display_second) ? display_fourth : display_first;
    end
endmodule

module mouse (input clock, inout PS2Clk, inout PS2Data, output [11:0] mouse_x, output [11:0] mouse_y, output left_out, output right_out, middle_out);
    reg setx = 0, sety = 0, setmax_x = 0, setmax_y = 0;
    reg [11:0] value = 0;
    reg rst;
    wire [11:0] xpos, ypos;
    wire [3:0] zpos;
    wire left, middle, right, new_event;
    
    MouseCtl MC (clock, rst, xpos[11:0], ypos[11:0], zpos[3:0], left, middle, right, new_event, value[11:0], setx, sety, setmax_x, setmax_y, PS2Clk, PS2Data);
    
    assign mouse_x = (xpos / 10 > 95) ? 95 : (xpos / 10 < 1) ? 1 : xpos / 10;
    assign mouse_y = (ypos / 10 > 63) ? 63 : (ypos / 10 < 1) ? 1 : ypos / 10;
    assign left_out = left;
    assign right_out = right;
    assign middle_out = middle;
endmodule



module clock_divider (input CLOCK, input [31:0] clockTime, output reg newClock);
    reg [31:0] COUNT = 0;
    initial begin newClock = 0; end
    always @ (posedge CLOCK) begin 
        COUNT <= (COUNT == clockTime) ? 0 : COUNT + 1;
        newClock <= (COUNT == 0) ? ~newClock : newClock;
        end
endmodule

module audio_display (input CLK, input MISO, input mouse_left, output clk_samp, output sclk, output reg [8:0] led, output reg [3:0] CA4_digit, output [3:0] display_animation);
    parameter DISPLAY_EGG = 4'b0001;   
    parameter DISPLAY_EGG_2 = 4'b0010;
    parameter DISPLAY_NUMBER = 4'b0000;
    
    wire clk_20kHz;            
    wire [11:0] MIC_in;    
    reg [3:0] display = DISPLAY_NUMBER;
    reg [31:0] clockTime = 2499;         
    reg [11:0] max_intensity = 12'b0;  
    reg [31:0] count1 = 32'b0;  
    reg [31:0] counter;    
    reg [31:0] egg_counter = 0;  
    reg [31:0] egg_counter_stage1 = 0;
    
    clock_divider cd(CLK, clockTime, clk_20kHz);
    Audio_Input ad(CLK,clk_20kHz,MISO,clk_samp,sclk,MIC_in[11:0]); 
    assign display_animation = display;
    
    always @ (posedge clk_20kHz) 
    begin
    count1 <= count1 + 1;
    if (MIC_in > max_intensity) 
    begin
        max_intensity <= MIC_in;
    end
    if (count1 == 1999)
         begin
         
         // For showing disco animation at every 0.2s
         if (display == DISPLAY_EGG)
            display <= DISPLAY_EGG_2;
         if (display == DISPLAY_EGG_2)
            display <= DISPLAY_EGG;
            
         if (max_intensity < 3499)
         begin
         
//         egg_counter <= 0; // reset egg_counter when audio intensity drops below 9
//         display_animation <= DISPLAY_NUMBER;
         if (max_intensity < 2167)
             begin
             led <= 9'b0;
             CA4_digit <= 0;           
             end
         if (max_intensity >= 2167 && max_intensity < 2334)
             begin                  
             led <= 9'b000000001;
             CA4_digit <= 1;     
             end   
         if (max_intensity >= 2334 && max_intensity < 2501)
             begin                 
             led <= 9'b000000011;
             CA4_digit <= 2;     
             end
         if (max_intensity >= 2501 && max_intensity < 2668)
             begin
             led <= 9'b000000111;
             CA4_digit <= 3;                              
             end                        
         if (max_intensity >= 2668 && max_intensity < 2835)
             begin
             led <= 9'b000001111;                
             CA4_digit <= 4;                    
             end
         if (max_intensity >= 2835 && max_intensity < 3002)
             begin
             led <= 9'b000011111;
             CA4_digit <= 5;         
             end                    
         if (max_intensity >= 3002 && max_intensity < 3169)
              begin             
              led <= 9'b000111111;
              CA4_digit <= 6;                
              end
         if (max_intensity >= 3169 && max_intensity < 3336)
              begin
              led <= 9'b001111111;
              CA4_digit <= 7;             
              end
         if (max_intensity >= 3336 && max_intensity < 3499)
                begin                   
                    led <= 9'b011111111;
                    CA4_digit <= 8;                
                end      
         end
         
         if (max_intensity >= 3499) // this trigger every 0.2 second
                begin                   
                    led <= 9'b111111111;
                    CA4_digit <= 9;     
                    egg_counter <= egg_counter + 1;
                    if (egg_counter == 10) // trigger egg animation when audio intensity stays at 9 for 2 sec
                        display <= DISPLAY_EGG;
                end
         max_intensity <= 0;
         count1 <= 32'b0;  
      end
      
      if ((mouse_left && display == DISPLAY_EGG)) begin
        display <= DISPLAY_NUMBER;
        egg_counter <= 0;
      end
      end
endmodule

module frequency_detector (input CLK, input MISO, output clk_samp, output sclk, output reg [8:0] led, output [31:0] freq);
    wire clk_20kHz;            
    wire [11:0] MIC_in;             
    reg [11:0] max_intensity = 12'b0;  
    reg [31:0] count1 = 32'b0;  
    reg [31:0] counter;  
    reg [31:0] freq_flag_1 = 0; // first amplitude peak, which represents start of measure of time elapsed
    reg [31:0] freq_flag_2 = 0; // second amplitude peak, distance from first peak gives us a rough signal frequency 
    reg flag = 0;               // to identify which amplitude peak we are at right now
    wire [31:0] frequency;
    
    Audio_Input ad(CLK,clk_20kHz,MISO,clk_samp,sclk,MIC_in[11:0]); 
    
    assign frequency = 1/(freq_flag_2 - freq_flag_1);
    assign freq = frequency;
    
    always @ (posedge clk_20kHz) 
    begin
    count1 <= count1 + 1;
    if (MIC_in > max_intensity) 
    begin
        max_intensity <= MIC_in; 
    end
    if (count1 == 1999 || count1 > 1999) // now max_intensity represents the peak amplitude of the incoming voice signal
         begin
     
         if ( (max_intensity - MIC_in < 100 || MIC_in - max_intensity < 100) && flag == 0 )
         begin
            freq_flag_1 <= count1;  // used to identify first amplitude peak
            flag <= 1;              // first freq_flag has been found
         end
         
         if ( (max_intensity - MIC_in < 100 || MIC_in - max_intensity < 100) && flag == 1 )
         begin
              freq_flag_2 <= count1;  // used to identify second consecutive amplitude peak
              flag <= 0;              // first freq_flag has been found
              count1 <= 0;
              max_intensity <= 0;
         end
      end
    if (freq < 100)
        led <= 9'b000000001;
    if (freq <= 150 && freq > 100)
        led <= 9'b000000011;
    if (freq <= 200 && freq > 150)
        led <= 9'b000000111;
    if (freq > 200)
        led <= 9'b000001111;
    end
endmodule

module Top_Student (input clock, inout PS2Clk, PS2Data, input [15:0] sw, input btnc, input btnd, input MISO,
output [7:0] jx, output [15:0] led, output [6:0] seg, output [3:0] an, output dp, output [3:0] JC,
output clk_samp, output sclk);
    // Delete this comment and include Basys3 inputs and outputs here
    
    //
    wire clk6p25m;
    slow_clock c1 (clock, 16, clk6p25m); // why 32?
    wire slower_clock;
    slow_clock c2 (clock, 100_000, slower_clock); 
    wire [11:0] mouse_x, mouse_y;
    wire left, right, middle;
    mouse ms (clock, PS2Clk, -PS2Data, mouse_x, mouse_y, left, right, middle);
    wire [12:0] pixel_index, x, y;
    get_pixel_position gpp (pixel_index, x, y);
    reg [6:0] segments = 7'b0; // represent the 7 segments enclosed by white bars that make up a digit on OLED
    reg previous_sw15 = 0;
    always @ (posedge clock) begin
        previous_sw15 <= sw[15];
        segments[0] <= (previous_sw15 && !sw[15]) ? 0 : (mouse_x >= 22 && mouse_x <= 38 && mouse_y >= 8 && mouse_y <= 12) ?  (left ? 1 : right ? 0 : segments[0]) : segments[0];
        segments[1] <= (previous_sw15 && !sw[15]) ? 0 : (mouse_x >= 38 && mouse_x <= 42 && mouse_y >= 12 && mouse_y <= 28) ? (left ? 1 : right ? 0 : segments[1]) : segments[1];
        segments[2] <= (previous_sw15 && !sw[15]) ? 0 : (mouse_x >= 38 && mouse_x <= 42 && mouse_y >= 32 && mouse_y <= 48) ? (left ? 1 : right ? 0 : segments[2]) : segments[2];
        segments[3] <= (previous_sw15 && !sw[15]) ? 0 : (mouse_x >= 22 && mouse_x <= 38 && mouse_y >= 48 && mouse_y <= 52) ? (left ? 1 : right ? 0 : segments[3]) : segments[3];
        segments[4] <= (previous_sw15 && !sw[15]) ? 0 : (mouse_x >= 18 && mouse_x <= 22 && mouse_y >= 32 && mouse_y <= 48) ? (left ? 1 : right ? 0 : segments[4]) : segments[4];
        segments[5] <= (previous_sw15 && !sw[15]) ? 0 : (mouse_x >= 18 && mouse_x <= 22 && mouse_y >= 12 && mouse_y <= 28) ? (left ? 1 : right ? 0 : segments[5]) : segments[5];
        segments[6] <= (previous_sw15 && !sw[15]) ? 0 : (mouse_x >= 22 && mouse_x <= 38 && mouse_y >= 28 && mouse_y <= 32) ? (left ? 1 : right ? 0 : segments[6]) : segments[6];
    end
    
    wire [3:0] number;
    get_number_from_segments good_night (segments, number);
        
    wire is_active = number <= 9 && sw[15];
    assign led[15] = is_active;
      
    wire [3:0] display_animation; // control what shows up on OLED
    wire [3:0] CA4_digit;
    wire [15:0] RGB;
//    wire [31:0] freq;
//    wire [8:0] led_display_freq;
//    wire [8:0] led_display_intensity;
//    assign led[8:0] = sw[0] ? led_display_intensity : led_display_freq;
    audio_display ad (clock, MISO, left, clk_samp, sclk, led [8:0], CA4_digit[3:0], display_animation);
//    frequency_detector fd (clock, MISO, clk_samp, sclk, led_display_freq[8:0], freq);
    color_from_audio (CA4_digit[3:0], RGB[15:0]);
       
    display_in_seven_segments display (slower_clock, number, CA4_digit[3:0], is_active, seg, an, dp);
        
    wire frame_begin, sending_pixels, sample_pixel;
    wire [15:0] oled_data;
    
    display disp (display_animation, segments, x, y, mouse_x, mouse_y, left, right,middle, pixel_index, is_active, sw[15], oled_data, clock, btnd, RGB);  
    Oled_Display O_disp (clk6p25m, btnc, frame_begin, sending_pixels, sample_pixel, pixel_index, oled_data, jx[0], jx[1], jx[3], jx[4], jx[5], jx[6], jx[7]);

    //AUDIO_OUT
    wire clk50M, clk20k, clk190, clk380;
    wire [11:0] audio_out; wire signal; 
    clock_divider clk50MHz(clock, 1, clk50M);
    clock_divider clk20kHz(clock, 2499, clk20k);
    clock_divider clk190Hz(clock, 263156, clk190);
    clock_divider clk380Hz(clock, 131578, clk380);
    button_detection testOledNum(clock, sw[15], signal);
    audio_all_tasks(clock, clk190, clk380, btnc, sw, is_active, number, audio_out);
    Audio_output myAudioOutput (.CLK(clk50M), .START(clk20k), .DATA1(audio_out), .DATA2(), .RST(0), .D1(JC[1]), .D2(JC[2]), .CLK_OUT(JC[3]), .nSYNC(JC[0]), .DONE());
endmodule